import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';
import Button from "@material-ui/core/Button";
import homepageimage1 from './homepageimage1.jpg';
import homepageimage2 from './homepageimage2.jpg';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      numClicks: 0
  }}

  handleClick = () => {
    this.setState({
      numClicks: this.state.numClicks + 1
    });

  }
  render() {
    return (
      <div className="App">
        <nav className="navbar overall-menu">

          <h3 className="navbar-brand">Hope in Seattle</h3>
          <ul className="menu-options">
            <li className="nav-item">Home</li>
            <li className="nav-item">About our Organization</li>
            <li className="nav-item">The Facts</li>
            <li className="nav-item">How to Help</li>
          </ul>

        </nav>

        <main>
          <section>
            <img className="opacity60 container-fluid p-0" src={homepageimage1} alt="holding hands 2"/>
            <div className="centered">
              <h1 className="display-1 font-weight-bold">Hope in Seattle</h1>
              <p className="h3">Our goal is to connect you to opportunities where you can</p>
              <p className="h3">apply your skills to help the homeless community in Seattle</p>
              <Button variant="contained" color="primary" onClick={this.handleClick}>
              How to Help
              </Button>

            </div>


          </section >
          <section>

          </section>
          <section>
            <img className="opacity60 container-fluid p-0" src={homepageimage2} alt="holding hands 2"/>
            <div className="centered2">
              <p className="h3">“Lorem ipsum dolor sit amet, consectetur</p>
              <p className="h3">adipiscing elit, sed do eiusmod tempor</p>
              <p className="h3">incididunt ut labore et dolore magna</p>
              <p className="h3">aliqua.”</p>
              <Button variant="contained" color="primary" onClick={this.handleClick}>
              How to Help
              </Button>

            </div>

          </section>



        </main>

      </div>
    );
  }
}

export default App;
